''' Done
给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。

示例 1:

输入: "abcabcbb"
输出: 3 
解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。
示例 2:

输入: "bbbbb"
输出: 1
解释: 因为无重复字符的最长子串是 "b"，所以其长度为 1。
示例 3:

输入: "pwwkew"
输出: 3
解释: 因为无重复字符的最长子串是 "wke"，所以其长度为 3。
     请注意，你的答案必须是 子串 的长度，"pwke" 是一个子序列，不是子串。
'''


class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if s == "":
            return 0

        maxLen = 1  # 字符串不为空，至少有 1 个
        dicLet = set()

        allLen = len(s)
        for curLen in range(2, allLen + 1):
            for idx0 in range(allLen - curLen + 1):  # 定长循环起始下标
                # 元素下标变量
                for i in range(curLen):
                    oneLetter = s[idx0 + i]
                    if oneLetter not in dicLet:
                        if i + 1 == curLen:
                            maxLen = curLen
                        else:
                            dicLet.add(oneLetter)
                    else:
                        break

                dicLet.clear()

                if maxLen == curLen: # 当前长度已经找到，不要再测了
                    break
            
            if curLen > maxLen: # 当前长度一个都没找到，就不要再往后找了
                break

        return maxLen


